import React from "react";
import AddUser from "./components/Users/AddUser";
import ShowUsers from "./components/Users/ShowUsers";
let ListData = [
  {
      username: 'Aneesh',
      age: '2',
  },
  {
    name: "2",
  },
];

function App(props) {
  console.log(props);
  return (
    <div>
      <AddUser DataRecieved={ListData} />
      <ShowUsers />
    </div>
  );
}

export default App;
